import styled from 'styled-components'
import HighlightOffIcon from '@mui/icons-material/HighlightOff';
import EditIcon from '@mui/icons-material/Edit';
function Task() {
  return (
    <Container>
        <p>Read a book</p>
        <IconContent>
        <HighlightOffIcon/>
        <EditIcon/>
        </IconContent>
    </Container>
  )
}

export default Task


